import { useState } from 'react'
import './register.css'

function Register() {

  const [name,setName]=useState("")
  const [email,setEmail]=useState("")
  const [password,setPass]=useState("")

  const handleChange=(e)=>{
    e.preventDefault()
    axios.post("http://localhost:4000/register",{
      name,email
    })
  }

  return (
    <div className='contianer'>
        <div className='wrapper'>
            <div className='cart'>
              <form onSubmit={handleChange}>
              <label htmlFor='1'>name
                <input type='text' id="1" onChange={(e)=>setName(e.target.value)}/>
              </label>
              <label htmlFor='2'>Email
                <input type='email' id="2" onChange={(e)=>setEmail(e.target.value)}/>
              </label>
              <label htmlFor='3'>Password
                <input type='password' id="3" onChange={(e)=>setPass(e.target.value)}/>
              </label>
              <input type='submit' value="SUBMIT"/>
              </form>
            </div>
        </div>
    </div>
  )
}

export default Register
